import {Routes as Switch, Route, BrowserRouter} from 'react-router-dom';
import Home from './Home';
import AvailableCourses from './AvailableCourses';
import CourseDetail from './CourseDetail';
//Teacher
import TeacherSignup from './Teacher/TeacherSignup';
import TeacherLogin from './Teacher/TeacherLogin';
import TeacherProfile from './Teacher/TeacherProfile';
import TeacherMyCourses from './Teacher/TeacherMyCourses';
import TeacherAddCourse from './Teacher/TeacherAddCourse';
import TeacherMyUsers from './Teacher/TeacherMyUsers';
import TeacherProfileSettings from './Teacher/TeacherProfileSettings';
import TeacherChangePassword from './Teacher/TeacherChangePassword';
import TeacherLogout from './Teacher/TeacherLogout';
import AddChapter from './Teacher/AddChapter';
import AllChapters from './Teacher/AllChapters';
import EditChapter from './Teacher/EditChapter';
import EditCourse from './Teacher/EditCourse';
import YesButton from './Teacher/YesButton';
import EnrolledStudents from './Teacher/EnrolledStudents';
import StudyMaterials from './Teacher/StudyMaterials';
import AddStudyMaterial from './Teacher/AddStudyMaterial';
import AttemptedStudents from './Teacher/AttemptedStudents';
import TeacherForgotPassword from './Teacher/TeacherForgotPassword';
import VerifyTeacher from './Teacher/VerifyTeacher';
import TeacherChangeForgotPassword from './Teacher/TeacherForgotChangePassword';
import AddAssignment from './Teacher/AddAssignment';
import EditAssignment from './Teacher/EditAssignment';
import TeacherSearch from './Teacher/TeacherSearch';
//User
import UserLogin from './User/UserLogin';
import UserSignup from './User/UserSignup';
import UserProfile from './User/UserProfile';
import UserLogout from './User/UserLogout';
import UserHeader from './User/UserHeader';
import UserMyCourses from './User/UserMyCourses';
import UserFavoriteCourses from './User/UserFavoriteCourses';
import UserRecommendedCourses from './User/UserRecommendedCourses';
import UserProfileSettings from './User/UserProfileSettings';
import UserChangePassword from './User/UserChangePassword';
import Search from './User/UserSearch';
import VerifyUser from './User/VerifyUser';
import UserForgotPassword from './User/UserForgotPassword';
import UserChangeForgotPassword from './User/UserForgotChangePassword';
import UserMyTeachers from './User/UserMyTeachers';

//Quiz
import TeacherMyQuizzes from './Teacher/TeacherMyQuizzes';
import AddQuiz from './Teacher/AddQuiz';
import EditQuiz from './Teacher/EditQuiz';
import AllQuestions from './Teacher/AllQuestions';
import AddQuestion from './Teacher/AddQuestion';
import AssignQuiz from './Teacher/AssignQuiz';
import CheckQuizInCourse from './Teacher/CheckQuizInCourse';
import CourseQuizList from './User/CourseQuizList';
import TakeQuiz from './User/TakeQuiz';
import CheckQuizStatusForUser from './User/CheckQuizStatusForUser';
import QuizResChild from './Teacher/QuizResChild';
import GeneralSearch from './GeneralSearch';
import ContactUs from './Contactus';
import FAQ from './FAQ';
import TeacherSidebar from './Teacher/TeacherSidebar';
import UserSidebar from './User/UserSidebar';
import QuestionDetail from './Teacher/QuestionDetail';
import UserDetail from './Teacher/UserDetail';
import TeacherDetail from './User/TeacherDetail';













function Main() {
  return (
    <div className="App">
      <BrowserRouter >
      <Switch>
        <Route path='/' element={<Home />} /> 
        <Route path='/available-courses' element={<AvailableCourses />} /> 
        <Route path='/course_detail/:course_id' element={<CourseDetail />} /> 
        <Route path='/general-search/:searchstring' element={<GeneralSearch />} />
        <Route path='/contact-us' element={<ContactUs />} /> 
        <Route path='/faq' element={<FAQ />} /> 
        {/*Teacher */}
        <Route path='/teacher-sidebar' element={<TeacherSidebar />} />
        <Route path='/teacher-signup' element={<TeacherSignup />} />
        <Route path='/teacher-login' element={<TeacherLogin />} />
        <Route path='/teacher-profile' element={<TeacherProfile />} />
        <Route path='/teacher-my-courses' element={<TeacherMyCourses />} />
        <Route path='/teacher-add-course' element={<TeacherAddCourse />} />
        <Route path='/teacher-my-users' element={<TeacherMyUsers />} />
        <Route path='/teacher-profile-settings' element={<TeacherProfileSettings />} />
        <Route path='/teacher-change-password' element={<TeacherChangePassword />} />
        <Route path='/teacher-logout' element={<TeacherLogout />} />
        <Route path='/teacher-logout-yes' element={<YesButton />} />
        <Route path='/teacher-add-chapter/:course_id' element={<AddChapter />} />
        <Route path='/teacher-all-chapters/:course_id' element={<AllChapters />} />
        <Route path='/teacher-edit-chapter/:chapter_id' element={<EditChapter />} />
        <Route path='/teacher-edit-course/:course_id' element={<EditCourse />} />
        <Route path='/teacher-enrolled-students/:course_id' element={<EnrolledStudents />} />
        <Route path='/teacher-study-materials/:course_id' element={<StudyMaterials />} />
        <Route path='/add-study-material/:course_id' element={<AddStudyMaterial />} />
        <Route path='/attempted-users/:quiz_id' element={<AttemptedStudents />} />
        <Route path='/quiz-result-ch/' element={<QuizResChild />} />
        <Route path='/teacher-verify/:teacher_id' element={<VerifyTeacher />} />
        <Route path='/teacher-forgot-password' element={<TeacherForgotPassword />} />
        <Route path='/teacher-change-forgot-password/:teacher_id' element={<TeacherChangeForgotPassword />} />
        <Route path='/teacher-add-assignment/:course_id' element={<AddAssignment />} />
        <Route path='/teacher-edit-assignment/:assignment_id' element={<EditAssignment />} />
        <Route path='/teacher-search/:searchstring' element={<TeacherSearch />} />
        <Route path='/question-detail/:question_id' element={<QuestionDetail />} />
        <Route path='/user-detail/:user_id' element={<UserDetail />} />
        {/*User */}
        <Route path='/user-sidebar' element={<UserSidebar />} />
        <Route path='/user-login' element={<UserLogin />} />
        <Route path='/user-signup' element={<UserSignup />} />
        <Route path='/user-profile' element={<UserProfile />} />
        <Route path='/user-logout' element={<UserLogout />} />
        <Route path='/user-header' element={<UserHeader />} />
        <Route path='/user-my-courses' element={<UserMyCourses />} />
        <Route path='/user-my-teachers' element={<UserMyTeachers />} />
        <Route path='/user-favorite-courses' element={<UserFavoriteCourses />} />
        <Route path='/user-recommended-courses' element={<UserRecommendedCourses />} />
        <Route path='/user-profile-settings' element={<UserProfileSettings />} />
        <Route path='/user-change-password' element={<UserChangePassword />} />
        <Route path='/user-search/:searchstring' element={<Search />} />
        <Route path='/user-verify/:user_id' element={<VerifyUser />} />
        <Route path='/user-forgot-password' element={<UserForgotPassword />} />
        <Route path='/user-change-forgot-password/:user_id' element={<UserChangeForgotPassword />} />
        <Route path='/teacher-detail/:teacher_id' element={<TeacherDetail />} />

        {/*Quiz */}
        <Route path='/teacher-my-quizzes' element={<TeacherMyQuizzes />} />
        <Route path='/teacher-add-quiz' element={<AddQuiz />} />
        <Route path='/teacher-edit-quiz/:quiz_id' element={<EditQuiz />} />
        <Route path='/teacher-all-questions/:quiz_id' element={<AllQuestions />} />
        <Route path='/teacher-add-question/:quiz_id' element={<AddQuestion />} />
        <Route path='/assign-quiz/:course_id' element={<AssignQuiz />} />
        <Route path='/check-quiz-status' element={<CheckQuizInCourse />} />
        <Route path='/user-quiz-list/:course_id' element={<CourseQuizList />} />
        <Route path='/user-take-quiz/:quiz_id' element={<TakeQuiz />} />
        <Route path='/check-quiz-status-for-user' element={<CheckQuizStatusForUser />} />
        <Route path='/quiz-res-child' element={<QuizResChild />} />
      </Switch>
      </BrowserRouter>
    </div>
  );
}

export default Main;
